    "pacific-remote-islands-marine-national-monument-narrative-report-1989-calendar-year",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Pacific
    Remote Islands National Wildlife Refuges (including Johnston Atoll, Rose Atoll,
    Howland Island, Baker Island, and Jarvis Island NWRs) outlines Refuge accomplishments
    during the 1989 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. The report includes a planning section which discusses the
    management plan, compliance with environmental and cultural resource mandates, and
    research and investigations. Refuge administration is outlined; information about
    personnel, volunteer programs, and funding is given. Habitat management is also
    covered; subjects include grasslands and pest control. The wildlife section of the
    report discusses wildlife diversity, endangered and threatened species, shorebirds,
    raptors, marine mammals, fisheries resources, scientific collections, animal control,
    and marking and banding. The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive programs, fishing, outdoor recreation,
    and law enforcement.",nt"license_title": "License Not Specified",nt"extras":
